        <?xml version="1.0" encoding="UTF-8"?>
        <data_quality_summary_definition>
          <id>FEC75FB2-A2DF-AB7E-1A0E-22C10DCA8AF6</id>
          <summary>&lt;p&gt;This particular data product requires additional processing. Due to the current demand, the turnaround time for producing these products has increased. As a result, orders are limited to&amp;nbsp;2000&amp;nbsp;granules per order.&amp;nbsp;To improve the efficiency of the additional processing, all orders up to 2000 granules will be divided into separate requests of 100 granules each with a unique download link for each set of 100 (or less) granules.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;
        &lt;p&gt;Please contact LP DAAC User Services at&amp;nbsp;&lt;a href="mailto:lpdaac@usgs.gov" target="_blank"&gt;lpdaac@usgs.gov&lt;/a&gt;&amp;nbsp;with any questions or comments.&amp;nbsp;&lt;/p&gt;</summary>
